  /** @type {!$jscomp.AsyncGeneratorWrapper$ExecutionFrame_<VALUE>} */
  this.frame = frame;
  /** @type {$jscomp.AsyncGeneratorWrapper$ExecutionNode_<VALUE>} */
  this.next = next;
