 * @constructor
 * @implements {AsyncGenerator<VALUE>}
 * @implements {AsyncIterable<VALUE>}
 * @template VALUE
 * @suppress {reportUnknownTypes}
 */
$jscomp.AsyncGeneratorWrapper = function(
    /** @type {!Generator<$jscomp.AsyncGeneratorWrapper$ActionRecord<VALUE>>} */
    generator) {
